    function formatNumberWithDots(x) {
        return x.toString().replace(/\B(?=(\d{3})+(?!\d))/g, ".");
    }

    // Функция для добавления/обновления текста уведомления
    epilepsialoader.addLabel = function (message) {
        if (!hudNotificationElement) {
            createNotificationElement();
        }
        hudNotificationElement.querySelector('.notification-text').textContent = message || 'SINCEWAYZ WINTER GTA';
        // Сбрасываем таймер и показываем заново
        clearTimeout(hudNotificationTimeout);
        // Плавное появление
        hudNotificationElement.style.opacity = '1';
        hudNotificationElement.style.transform = 'translateY(0)';
        hudNotificationTimeout = setTimeout(() => {
            hudNotificationElement.style.opacity = '0';
            hudNotificationElement.style.transform = 'translateY(20px)';
            setTimeout(() => {
                if (hudNotificationElement && hudNotificationElement.parentNode) {
                    hudNotificationElement.parentNode.removeChild(hudNotificationElement);
                }
            }, 300);
        }, 5000); // 5 секунд
    };

    let hudNotificationElement;
    let hudNotificationTimeout;

    function createNotificationElement() {
        hudNotificationElement = document.createElement('div');
        hudNotificationElement.id = 'epilepsia-hud-notification';
        hudNotificationElement.innerHTML = `
            <div class="notification-icon">
                <svg width="41" height="41" viewBox="0 0 24 24" fill="none" xmlns="http://www.w3.org/2000/svg">
                    <circle cx="12" cy="12" r="12" fill="#27ae27ff"/>
                    <path d="M8 12L10.5 14.5L16 9" stroke="white" stroke-width="2" stroke-linecap="round" stroke-linejoin="round"/>
                </svg>
            </div>
            <span class="notification-text">SIMPLE GTA</span>
        `;
        document.body.appendChild(hudNotificationElement);

        // Применяем стили
        const style = document.createElement('style');
        style.textContent = `
            #epilepsia-hud-notification {
                position: fixed;
                bottom: 20px;
                right: 20px;
                background: white;
                border: 5px solid #27AE60;
                border-radius: 14px; /* Более квадратные, но с лёгким скруглением */
                padding: 20.4px 34px;
                box-shadow: 0 5px 12px rgba(0, 0, 0, 0.4);
                display: flex;
                align-items: center;
                gap: 20px;
                font-family: Arial, sans-serif;
                font-weight: 700;
                color: #333;
                opacity: 0; /* Начальное состояние: полностью прозрачно */
                transform: translateY(20px); /* Начальное положение: чуть ниже */
                transition: opacity 0.4s ease-out, transform 0.4s ease-out; /* Плавность */
                z-index: 9999;
            }
            .notification-icon svg {
                width: 41px;
                height: 41px;
            }
            .notification-text {
                font-size: 27.2px;
            }
        `;
        document.head.appendChild(style);

        // Плавное появление при создании
        // Используем setTimeout, чтобы браузер применил начальное состояние (opacity 0)
        setTimeout(() => {
            hudNotificationElement.style.opacity = '1';
            hudNotificationElement.style.transform = 'translateY(0)';
        }, 10);

        // Автоматическое исчезновение через 5 секунд
        hudNotificationTimeout = setTimeout(() => {
            hudNotificationElement.style.opacity = '0';
            hudNotificationElement.style.transform = 'translateY(20px)';
            setTimeout(() => {
                if (hudNotificationElement && hudNotificationElement.parentNode) {
                    hudNotificationElement.parentNode.removeChild(hudNotificationElement);
                }
            }, 300);
        }, 5000);
    }

